import Head from "next/head";
import { Container } from "./about";

export default function TalksPage() {
  return (
    <Container>
      <Head>
        <title> Tech Talks of Vilva Athiban P B | JavaScript developer & Trainer</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
    </Container>
  );
}
